import React, { useState } from "react";
import "./App.css";
import Filters from "./Filters";
import Plots from "./Plots";

function App() {
  const [filters, setFilters] = useState({
    selectedSites: [], // Stores selected sites
    selectedParameters: [], // Stores selected water quality parameters
    startDate: new Date(new Date().setFullYear(new Date().getFullYear() - 2)), // Default to past 2 years
    endDate: new Date(), // Default to today
  });

  return (
    <div className="dashboard">
      <header className="header">NW Michigan Watershed Coalition</header>
      <div className="container">
        <Filters onFilterChange={setFilters} />
        <main className="plots">
          {/* Pass all required props */}
          <Plots 
            selectedParameters={filters.selectedParameters} 
            selectedSites={filters.selectedSites} 
            startDate={filters.startDate} 
            endDate={filters.endDate} 
          />
        </main>
        <section className="map">Map</section>
      </div>
    </div>
  );
}

export default App;
